import React, { useEffect } from "react";
import Header from "./header";
import MainFooter from "./mainFooter";
import { useNavigate } from "react-router-dom";
import "./reset.css";
import "../asset/profile.scss";

function Profile(props) {
  let profileList = [1, 2, 3, 4, 5, 6];

  const select = "id";

  let loadSelect = localStorage.getItem(select);

  const navigate = useNavigate();

  return (
    <div>
      <div className="wrap profile_wrap">
        <Header />
        <section className="section01">
          <div className="my_profile">
            <figure>
              <img
                src={`/img/profile${
                  loadSelect === null ? 1 : loadeedSelect
                }.svg`}
                alt=""
              ></img>
            </figure>
            <figcaption>현재프로필</figcaption>
          </div>
        </section>
        <section className="section02">
          <div className="in_wrap">
            {profileList.map(function (a, i) {
              return (
                <figure
                  className="select_profile"
                  key={i}
                  onClick={() => {
                    props.dispatch({ type: "id값전송", payload4: i + 1 });
                  }}
                >
                  <img src={`/img/profile${i + 1}.svg`} alt=""></img>
                </figure>
              );
            })}
            <button
              onClick={() => {
                navigate("/Mypage");
              }}
            >
              바꾸기
            </button>
          </div>
        </section>
      </div>
      <MainFooter />
    </div>
  );
}

export default Profile;
